CREATE TRIGGER `bal` BEFORE INSERT ON `tblsaldo` FOR EACH ROW IF new.in = 0 THEN

SET new.bal = (SELECT COALESCE(SUM( `in` - `out` ),0) as sisasaldo FROM tblsaldo WHERE idUser = new.idUser)  -   new.out ;

ELSEIF 	 new.out = 0 THEN 

SET new.bal = (SELECT COALESCE(SUM( `in` - `out` ),0) as sisasaldo FROM tblsaldo WHERE idUser = new.idUser)  +  new.in  ;

END IF
$$
